<html>

<head>
    <title>Gerenciador de Impressao Web Siare</title>

    <script type="text/javascript" src="lib/jquery-3.4.1.min.js"></script>
    <link rel="stylesheet" type="text/css" href="lib/jquery-ui-1.12.1.custom/jquery-ui.min.css">
    <script type="text/javascript" src="lib/jquery-ui-1.12.1.custom/jquery-ui.min.js"></script>

    <link rel="stylesheet" type="text/css" href="css/style.css" />
    <link rel="stylesheet" type="text/css" href="css/font-awesome-4.6.3/css/font-awesome.min.css">
    <!--link rel="stylesheet" type="text/css" href="css/popup.css"-->
    <!--link rel="stylesheet" type="text/css" href="css/tabela_web.css"-->

    <script src="lib/uniform/jquery.uniform.js" type="text/javascript"></script>
    <script src="lib/i18n_translator.js" type="text/javascript"></script>
    <script src="lib/object-watch.js" type="text/javascript"></script>

    <script type="text/javascript" src="popup.js"></script>
</head>

<body class="unselectable">
    <div id="loader-container1">
        <div id="TituloTabela" align="center">
            <h2 id="TitTab">Relatórios Gerados</h2>
        </div>
        <table id="Tabela" cellspacing="15" cellpadding="15"></table>
    </div>

    <div id="loader-container">
        <i class="fa fa-cog fa-spin fa-3x"></i>
    </div>

    <div id="alert_wrapper">
        <div id="alert_background"></div>
        <div id="alert_box">
            <div id="alert_title">
                <p id="alert_title_p"></p>
            </div>
            <div id="alert_buttons">
                <div id="alert_ok" class="alert_button" i18n="yes"></div>
                <div id="alert_cancel" class="alert_button" i18n="no"></div>
            </div>
        </div>
    </div>
</body>

</html>
